import React from 'react';
import GoogleMapReact from 'google-map-react';
import './css/GoogleMap.css';

const AnyReactComponent = ({ text }) => (
  <div style={{ position: 'relative' }}>
    <img
      src="/pin.png"
      alt="Custom Marker"
      className="custom-marker"
      style={{
        position: 'absolute',
        top: '-32px',
        left: '-12px',
      }}
    />
    {text}
  </div>
);

const GoogleMap = () => {
  const defaultProps = {
    center: {
      lat: 4.62401935,
      lng: -74.0720511796302,
    },
    zoom: 14,
  };


  const markers = [
    {
      id: 1,
      lat: 4.641542013636317,
      lng: -74.09167213103521,
    },
    // Add more markers as needed
  ];

  return (
    <div className="map-container">
      <GoogleMapReact
        bootstrapURLKeys={{
          key: 'AIzaSyBoEQde7SsgSK7o3C89akbT1Z6dDl2T6nA',
        }}
        defaultCenter={defaultProps.center}
        defaultZoom={defaultProps.zoom}
      >
        {markers.map((marker) => (
          <AnyReactComponent
            key={marker.id}
            lat={marker.lat}
            lng={marker.lng}
            text="Marker Text"
          />
        ))}
      </GoogleMapReact>
    </div>
  );
};

export default GoogleMap;
